import React, {Component} from 'react';
import CategoryCard from "./CategoryCard";
import "./categoryList.css";

const genre = ["Drama","Romance","Adventure", "Poetry"];
export default class CategoryList extends Component {
    constructor(props){
        super(props);
    }
    render() {
        return (
            <div className="category-list">
                <CategoryCard title="Fiction" image="https://jamesclear.com/wp-content/uploads/2015/02/The-Little-Prince-by-Antoine-de-Saint-Exupery-560x700.jpg"></CategoryCard>
                <CategoryCard title="Non-Fiction" image="https://www.abebooks.com/images/books/essential-non-fiction/caged-bird.jpg"></CategoryCard>
                <CategoryCard title="Biography" image="https://images-na.ssl-images-amazon.com/images/I/81VStYnDGrL.jpg"></CategoryCard>
                <CategoryCard title="History" image="https://images.gr-assets.com/books/1535529056l/41458663.jpg"></CategoryCard>
            </div>

        );
    }
}
